import React, { Fragment, useState } from 'react';
import axios from 'axios';

const AddSubAdminForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phoneNumber: '',
    city: '',
    address: '',
    cnic: ''
  });

  const { name, email, phoneNumber, city, address, cnic } = formData;

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onSubmit = async e => {
    e.preventDefault();
  };

  const addSubAdmin = async () => {
    const config = {
      headers: {
        'Content-Type': 'application/json'
      }
    };

    try {
      await axios.post('/api/admin/add/subadmin', formData, config);
    } catch (err) {
      console.log(err.message);
    }
  };

  return (
    <Fragment>
      <div className='container'>
        <div className='row'>
          <div className='col-12 heading'>Add Sub Admin</div>
        </div>
        <div className='row'>
          <div className='col-12'>
            <form onSubmit={e => onSubmit(e)}>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='Name'
                  className='form-control'
                  name='name'
                  value={name}
                  onChange={e => onChange(e)}
                />
              </div>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='Email'
                  className='form-control'
                  name='email'
                  value={email}
                  onChange={e => onChange(e)}
                />
              </div>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='Phone Number'
                  className='form-control'
                  name='phoneNumber'
                  value={phoneNumber}
                  onChange={e => onChange(e)}
                />
              </div>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='City'
                  className='form-control'
                  name='city'
                  value={city}
                  onChange={e => onChange(e)}
                />
              </div>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='Address'
                  className='form-control'
                  name='address'
                  value={address}
                  onChange={e => onChange(e)}
                />
              </div>
              <div className='form-group'>
                <input
                  type='text'
                  placeholder='CNIC'
                  className='form-control'
                  name='cnic'
                  value={cnic}
                  onChange={e => onChange(e)}
                />
              </div>
              <input type='submit' value='Submit' className='btn btn-primary' />
            </form>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default AddSubAdminForm;
